script: |
  super -f text -I q5240.spq | sort > q5240.out

inputs:
  - name: q5240.spq
    data: |
      SELECT DISTINCT + col1 * - col0 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( - 29 * - - 33 * + CAST ( NULL AS INTEGER ) * + + col1 * + 75 ) NOT IN ( + col1 );
  - name: tab0

outputs:
  - name: q5240.out
    data: |
